def print_level(f, p='', indent='-'):
    for item in f.keys():
        if hasattr(f[item], 'keys'):
            p = print_level(f[item], p=p, indent=indent + indent[0])
        elif indent[-1] != ' ':
            indent = indent + ''
        p = indent + item + '\n' + p
    return p
